import ContumazHead from '../components/contumaz_head';
import ContumazAside from '../components/contumaz_aside';

function Post() {
    return (
      <div>
        <ContumazHead/>
        <body>
          <ContumazAside/>
          <h1>Title</h1>
          <h2>Subtitle</h2>
          <p>Date</p>
          <p>Text</p>
          <p>Autor</p>
        </body>
      </div>
    );
}
export default Post;
